def determine_poker_hand_role(hand: list) -> str:
    hand = sorted(hand)
    if hand.count(hand[0]) == 4 and hand.count(hand[1]) == 4:
        return 'four card'
    elif len(set(hand)) == 2:
        return 'full house'
    elif hand[0] + 4 == hand[1] + 3 == hand[2] + 2 == hand[3] + 1 == hand[4] or hand == [1, 10, 11, 12, 13]:
        return 'straight'
    elif max(hand.count(hand[0]), hand.count(hand[1]), hand.count(hand[2])) == 3:
        return 'three card'
    elif len(set(hand)) == 3:
        return 'two pair'
    elif len(set(hand)) == 4:
        return 'one pair'
    else:
        return 'null'

